import React from "react";

export default function Textfrom(props) {
  return (
    <>
      <div className="container my-4">
        <div class="mb-3">
             <h2>{props.heading}</h2>
          <textarea
            class="form-control"
            id="exampleFormControlTextarea1"
            rows="7"
          ></textarea>
        </div>
      </div>
    </>
  );
}
